<template>
  <v-img :max-height="height" :max-width="width" :src="srcImageBase64" />
</template>

<script>
export default {
  props: {
    width: {
      type: Number,
      default: 184
    },
    height: {
      type: Number,
      default: 184
    },
    origin: {
      type: Boolean,
      default: false
    }
  },

  computed: {
    srcImage() {
      if (this.origin) return '/img/logo-app.webp';
      if (this.$vuetify.theme.dark) return '/img/logo-app-light.webp';
      else return '/img/logo-app-dark.webp';
    },

    srcImageBase64() {
      if (this.origin)
        return ' data:image/webp;base64,';
      if (this.$vuetify.theme.dark)
        return ' data:image/webp;base64,';
      else
        return ' data:image/webp;base64,';
    }
  }
};
</script>
